import React from 'react'

const Plane = () => {
    return (
        <div className="relative w-1/4 h-1/4 border border-gray-500">
            {/* X-axis */}
            <div className="absolute bottom-0 left-0 w-full border-t border-gray-500">
                Hi
            </div>

            {/* Y-axis */}
            <div className="absolute top-0 right-0 h-full border-l border-gray-500">
                Hi
            </div>
        </div>
        );
 };

export default Plane
